"use strict";

function calc() {
	const part1 = reactAll(input);

	let part2 = part1;

	"abcdefghijklmnopqrstuvwxyz".split("").forEach(c =>
		part2 = Math.min(part2, reactAll(input.split(c).join("").split(c.toUpperCase()).join(""))));

	return part1 + " " + part2;
}

function reactAll(a) {
	let cur = a;
	let prev = null;

	while (cur != prev) {
		prev = cur;
		cur = react(prev);
	}

	return cur.length;	
}

function react(a) {
	return a
		.split(/aA|Aa|bB|Bb|cC|Cc|dD|Dd|eE|Ee|fF|Ff|gG|Gg|hH|Hh|iI|Ii|jJ|Jj|kK|Kk|lL|Ll|mM|Mm|nN|Nn|oO|Oo|pP|Pp|qQ|Qq|rR|Rr|sS|Ss|tT|Tt|uU|Uu|vV|Vv|wW|Ww|xX|Xx|yY|Yy|zZ|Zz/g)
		.join("");
}

const input = ``;
